  false,\n\t\"url\": null,\n\t\"notes\": \"Provided by the U.S. Census Bureau, USA
  Trade Online is a dynamic data tool that gives users access to current and cumulative
  U.S. export and import data.  With multiple data sets and capabilities, USA Trade
  Online can assist different types of customers from a wide range of industries and
  fields.  Manufacturers and other businesses wishing to expand their business globally
  can utilize USA Trade Online to identify new markets, evaluate existing markets,
  and perform other market research tasks. The data available through this tool can
  also support economists in interpreting economic news and performing academic research,
  as well assist governments and federal agencies in analyzing domestic and international
  trade policies.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
